import React from "react";
import "./ContactStyle.css";
import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row';

class Contact extends React.Component {
  render() {
    return (
      <div className="main-div">
         <div class="naslov">
         <p id="prvi" >
            <b>
            Hello
            </b>
            
          </p>
          <br></br>
          <p id="drugi">
               Let's get in touch!
          </p>
          </div>
        <Row>
         <Card style={{ width: '18rem' }} id="kontakt">
            <Card.Body>
              <Card.Title>Contact information</Card.Title>
              <Card.Text> +387603505352 <br> </br>

                Patriotske lige 40, Sarajevo <br></br>
                email: sejla.pljakic@gmail.com 
                </Card.Text> 
            </Card.Body>
          </Card>
      </Row>

         
      </div>
    );
  }
}

export default Contact;
